import React from 'react';
import Link from 'next/link';
import styled from 'styled-components';

const NavWrapper = styled.div`
	display: flex;
`;
const RepoNavigation = () => {
	return (
		<NavWrapper>
			<Link href="/new">
				<a>만들기</a>
			</Link>
		</NavWrapper>
	);
};

export default RepoNavigation;
